 import * as Types from '../constants/ActionTypes';

let initialState = '';
const filterUserReducer  = (state = initialState, action) => {
    switch(action.type){
        case Types.SEARCH_USER :
            state = action.keyword;
            return state;
        
        default : return state;
    }
}
export default filterUserReducer;
